import React, {useContext} from 'react';
import TeamColors from './TeamColors'
export default function TeamHeader({ theme, loading, teamName, season }){
  const style = {
    "backgroundColor":theme.darkColor,
    "color": "#ffffff",
    "borderColor": theme.accentColor
  }
  return(
    <header style={style}>
      <div>
        <h1>{teamName}</h1>
      </div>
      <h1>{season}</h1>
    </header>
  );
}
